// const clockStyle = {
//     color: "white"
// }
let time =() =>{
    let dateObj = new Date()
    return dateObj.toTimeString().split(" ")[0]
}
export class Clock extends Component {
    render() {
        return (
            <div>
                <h1>TimeNow :{time}</h1> 
            </div>
        )
    }
}

export default Clock
